import React, { Component } from "react";
import { Link } from 'react-router-dom';


class Product extends Component {
	render() {
		return (
			<div class="col-md-3">
				<figure class="card card-product p-2">
					<div class="container-float">
						<span class="badge badge-danger float-right"> NEW </span>
					</div>
					<div class="img-wrap">
						<img src={require("../images/logo/logo.png")} />
					</div>
					<figcaption class="info-wrap pt-3">
						<p><a href="#" class="title text-decoration-none" style={{ fontWeight: 600 }}>
							this props namaProduk
						</a></p>
						<p>
							this props harga
						</p>
						<a>
							this props nama penjual
						</a>
						<div class="action-wrap">
							<a href="#" class="btn btn-primary btn-sm"> Order </a>

						</div>
					</figcaption>
				</figure>
			</div>
		);
	}
}

export default Product;
